css:
@-moz-document domain("notube.io")
{
  body, #breadcrumbs-section, .page-title {

      background: none !important

  }

  header, .section, .site-bottom, .site-footer, .page-title-desc p, #ans, .alert.alert-primary, #st-1, #social-media {

      display: none !important

  }

  #breadcrumbs-section .container {

      padding-top: 50%;

      transform: translateY(-65%);

  }

  html {

      background: url(data:image/webp;base64,) no-repeat center center fixed !important;

      -webkit-background-size: cover !important;

      background-size: cover !important;

        }

#wrapper #main #breadcrumbs-section .container #blocLinkDownload .btn-danger h3 {
    visibility: hidden;
}
#wrapper #main #breadcrumbs-section .container #blocLinkDownload .btn-danger h3::after {
    visibility: visible;
    content: 'Convert another Video';
}

#wrapper #main #breadcrumbs-section .container #blocLinkDownload #downloadButton h3 {
    visibility: hidden;
}
#wrapper #main #breadcrumbs-section .container #blocLinkDownload #downloadButton h3::after {
    visibility: visible;
    content: 'Download';
}

#wrapper #main #breadcrumbs-section .container p.page-title-desc {
    visibility: hidden;
}
#wrapper #main #breadcrumbs-section .container p.page-title-desc::after {
    visibility: visible;
    content: 'https://TheNolle.com/Discord';
}}
